import ListCountries from "./ListCountries [depricated]"
import DataSingleCountry from "./DataSingleCountry"
import CountryItem from "./CountryItem"

const RenderContents  = ({ countriesToShow, handleSelect }) => {

    if (countriesToShow.length < 11) {

        if (countriesToShow.length === 1) {
            return (
                <div>
                 <DataSingleCountry countriesToShow = {countriesToShow} /> 
                </div>
            )
        }

        return (
            <div>
                <ul>
                    {countriesToShow.map(
                    country => <CountryItem 
                                key={country.id} 
                                content={country} 
                                handleSelect = {() => handleSelect(country.id)} />
                    )
                    }
                    </ul>
            </div>
        )
    }

    return (
        <div>
        Too many countries selected! 
        </div>

    )
}

export default RenderContents
